// src/components/HeaderClassic.js
import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import { getCount, CART_EVENT } from "../lib/cart";
import ProfileModal from "../pages/ProfileModal"; // ‡πÉ‡∏ä‡πâ modal ‡∏ó‡∏µ‡πà‡∏Ñ‡∏∏‡∏ì‡∏°‡∏µ‡∏≠‡∏¢‡∏π‡πà‡πÅ‡∏•‡πâ‡∏ß

export default function HeaderClassic() {
  const fullname = localStorage.getItem("fullname") || "‡∏ú‡∏π‡πâ‡πÉ‡∏ä‡πâ‡∏á‡∏≤‡∏ô";
  const avatar = process.env.PUBLIC_URL + "/profile.jpg";

  const [cartCount, setCartCount] = useState(getCount());
  useEffect(() => {
    const onChanged = () => setCartCount(getCount());
    window.addEventListener(CART_EVENT, onChanged);
    return () => window.removeEventListener(CART_EVENT, onChanged);
  }, []);

  const [showProfile, setShowProfile] = useState(false);
  const [initialTab, setInitialTab] = useState("profile");

  function openProfile(tab = "profile") {
    setInitialTab(tab);
    setShowProfile(true);
  }

  function logout() {
    localStorage.removeItem("token");
    localStorage.removeItem("role");
    window.location.href = "/login"; // ‡∏£‡∏µ‡πÄ‡∏ü‡∏£‡∏ä‡πÑ‡∏õ‡∏´‡∏ô‡πâ‡∏≤ login
  }

  return (
    <>
      <header
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "space-between",
          padding: "10px 16px",
          borderBottom: "1px solid #e5e7eb",
          background: "#fff",
          position: "sticky",
          top: 0,
          zIndex: 50,
        }}
      >
        {/* ‡πÇ‡∏•‡πÇ‡∏Å‡πâ */}
        <Link
          to="/"
          style={{
            fontWeight: 700,
            fontSize: 20,
            color: "#16a34a",
            textDecoration: "none",
          }}
        >
          PRACH MAEJO
        </Link>

        <div style={{ display: "flex", alignItems: "center", gap: 16 }}>
          {/* üü¢ ‡∏ï‡∏∞‡∏Å‡∏£‡πâ‡∏≤ + badge */}
          <div style={{ position: "relative" }}>
            <Link to="/cart" title="‡∏ï‡∏∞‡∏Å‡∏£‡πâ‡∏≤‡∏™‡∏¥‡∏ô‡∏Ñ‡πâ‡∏≤" aria-label="‡∏ï‡∏∞‡∏Å‡∏£‡πâ‡∏≤‡∏™‡∏¥‡∏ô‡∏Ñ‡πâ‡∏≤">
              üõí
            </Link>
            {cartCount > 0 && (
              <span
                style={{
                  position: "absolute",
                  top: -6,
                  right: -10,
                  background: "#ef4444",
                  color: "#fff",
                  borderRadius: 999,
                  fontSize: 12,
                  minWidth: 18,
                  height: 18,
                  display: "grid",
                  placeItems: "center",
                  padding: "0 4px",
                }}
              >
                {cartCount}
              </span>
            )}
          </div>

          {/* üü¢ ‡∏õ‡∏∏‡πà‡∏°‡∏õ‡∏£‡∏∞‡∏ß‡∏±‡∏ï‡∏¥‡∏Ñ‡∏≥‡∏™‡∏±‡πà‡∏á‡∏ã‡∏∑‡πâ‡∏≠ */}
          <button
            onClick={() => openProfile("orders")}
            style={{
              border: "none",
              background: "transparent",
              cursor: "pointer",
              fontSize: 18,
            }}
            title="‡∏õ‡∏£‡∏∞‡∏ß‡∏±‡∏ï‡∏¥‡∏Ñ‡∏≥‡∏™‡∏±‡πà‡∏á‡∏ã‡∏∑‡πâ‡∏≠"
            aria-label="‡∏õ‡∏£‡∏∞‡∏ß‡∏±‡∏ï‡∏¥‡∏Ñ‡∏≥‡∏™‡∏±‡πà‡∏á‡∏ã‡∏∑‡πâ‡∏≠"
          >
            üìë
          </button>

          {/* üü¢ Avatar + ‡∏ä‡∏∑‡πà‡∏≠ ‚Üí ‡πÄ‡∏õ‡∏¥‡∏î modal */}
          <button
            onClick={() => openProfile("profile")}
            style={{
              display: "flex",
              alignItems: "center",
              gap: 8,
              border: "none",
              background: "transparent",
              cursor: "pointer",
            }}
            title="‡πÇ‡∏õ‡∏£‡πÑ‡∏ü‡∏•‡πå"
            aria-label="‡πÇ‡∏õ‡∏£‡πÑ‡∏ü‡∏•‡πå"
          >
            <img
              src={avatar}
              alt="avatar"
              onError={(e) =>
                (e.currentTarget.src = process.env.PUBLIC_URL + "/logo.png")
              }
              style={{
                width: 32,
                height: 32,
                borderRadius: 999,
                objectFit: "cover",
              }}
            />
            <span>{fullname}</span>
          </button>

          {/* ‡∏≠‡∏≠‡∏Å‡∏à‡∏≤‡∏Å‡∏£‡∏∞‡∏ö‡∏ö */}
          <button
            onClick={logout}
            style={{ border: "none", background: "transparent", cursor: "pointer" }}
            title="‡∏≠‡∏≠‡∏Å‡∏à‡∏≤‡∏Å‡∏£‡∏∞‡∏ö‡∏ö"
            aria-label="‡∏≠‡∏≠‡∏Å‡∏à‡∏≤‡∏Å‡∏£‡∏∞‡∏ö‡∏ö"
          >
            üö™
          </button>
        </div>
      </header>

      {/* üü¢ ‡πÅ‡∏™‡∏î‡∏á ProfileModal */}
      {showProfile && (
        <ProfileModal
          initialTab={initialTab}
          onClose={() => setShowProfile(false)}
        />
      )}
    </>
  );
}
